    template<int states,int cells>
    class resettable_bitarray{
        public:
            inline bool is_set(int state, int cell)const{
                return content[state][cell] == current_threshold;
            }

            inline void set(int state, int cell){
                content[state][cell] = current_threshold;
            }

            inline void reset(void){
                if(++current_threshold == 0){
                    ++current_threshold;
                    for(unsigned int i=0;i<states;++i){
                        for(unsigned int j=0;j<cells;++j){
                            content[i][j] = 0;
                        }
                    }
                }
            }

        private:
            unsigned int content[states][cells] = {};
            unsigned int current_threshold = 1;
    };

